import React from 'react';
import ReactDOM from 'react-dom';
import ParamEditor from './ParamEditor';

ReactDOM.render(<App />, document.getElementById('root'));

const params = [
  {
    id: 1,
    name: 'Назначение',
  },
  {
    id: 2,
    name: 'Длина',
  },
];

const model = {
  paramValues: [
    {
      paramId: 1,
      value: 'повседневное',
    },
    {
      paramId: 2,
      value: 'макси',
    },
  ],
  colors: [],
};

const App = () => {
  const [currentModel, setCurrentModel] = React.useState(model);

  const handleModelChange = (newModel) => {
    setCurrentModel(newModel);
  };

  return (
    <div>
      <ParamEditor params={params} model={currentModel} onModelChange={handleModelChange} />
      <button onClick={() => console.log(currentModel)}>Get Model</button>
    </div>
  );
};

ReactDOM.render(<App />, document.getElementById('root'));
